import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="app-container">
      <nav><Navbar />
      </nav>
      <br />
      <div className="piano-keyboard">
        <Piano />
      </div>
      <div className="recording-controls">
        <Recording />
      </div>
    </div>
  );
}

export default App;
